queries.query:
{
  allMarkdownRemark( filter: { fields: { slug: { ne: null } } }) {
    edges {
      node {
        objectID: fileAbsolutePath
        fields {
          slug
        }
        internal {
          content
        }
        frontmatter {
          title
        }
      }
    }
  }
}

pluginOptions.query:
{
  site {
    siteMetadata {
      title
      description
      siteUrl
      site_url: siteUrl
    }
  }
}

feeds.query:
{
  allMarkdownRemark(
    limit: 1000,
    sort: { order: DESC, fields: [fields___prefix] },
    filter: {
      fields: {
        prefix: { ne: null },
        slug: { ne: null }
      },
      frontmatter: {
        author: { ne: null }
      }
    }
  ) {
    edges {
      node {
        excerpt
        html
        fields {
          slug
          prefix
        }
        frontmatter {
          title
        }
      }
    }
  }
}
